import { useState } from "react"
import "./App.css"
import axios from "axios"
import BackEnd from "./Components/BackEnd"
import Database from "./Components/Database"
import FrontEnd from "./Components/FrontEnd"

const appsList = [
  {
    appId: 0,
    appName: 'React Js',
    imageUrl:
      'data:image/png;base64,',
    category: 'FRONTEND',
  },
  {
    appId: 1,
    appName: 'Angular',
    imageUrl:
      'data:image/png;base64,',
    category: 'FRONTEND',
  },
  {
    appId: 2,
    appName: 'Node Js',
    imageUrl:
      'https://www.quantumversity.com/wp-content/uploads/2020/11/Fundamentals-of-Node.png',
    category: 'BACKEND',
  },
  {
    appId: 3,
    appName: 'Django',
    imageUrl:
      'data:image/png;base64,',
    category: 'BACKEND',
  },
  {
    appId: 4,
    appName: 'MySql',
    imageUrl:
      'https://styles.redditmedia.com/t5_2qm6k/styles/communityIcon_dhjr6guc03x51.png?width=256&s=3e825b7205c7f497d4695028e358d26ee359f84b',
    category: 'DATABASE',
  },
  {
    appId: 5,
    appName: 'Sqllite',
    imageUrl:
      'data:image/jpeg;base64,',
    category: 'DATABASE',
  },

]


function App() {



  const frontList = appsList.filter((each) => each.category === "FRONTEND")
  const backendList = appsList.filter((each) => each.category === "BACKEND")
  const dadatabaseList = appsList.filter((each) => each.category === "DATABASE")
  const [f, setF] = useState(null)
  const [b, setB] = useState(null)
  const [d, setD] = useState(null)


  const change = (id) => {
    setF(id)


  }
  const change1 = (id) => {
    setB(id)
  }
  const change2 = (id) => {
    setD(id)

  }




  const CallApi = () => {
    const a = {
      "frontend": f,
      "backend": b,
      "database": d,
    }
    console.log(a)
    axios.get("https://jsonplaceholder.typicode.com/posts")
      .then(res => {
        console.log(res)
      })
      .catch(e => {
        console.log(e)
      })
    const arr = {
      userId: '101',
      title: 'ashok',
      body: 'ashok',
    }
    axios.post("https://jsonplaceholder.typicode.com/posts", arr)
      .then(res => {
        console.log(res)
      })
      .catch(e => {
        console.log(e)
      })

  }



  return (
    <div className="bg-container">
      <h1>Application Store</h1>
      <div className="frontend-card">
        <div className="head">
          <h2 >Front End</h2>
        </div>
        <div className="card">
          {
            frontList.map((each) => <FrontEnd appDetails={each} key={each.appId} change={change} isActive={each.appName === f ? true : false} />)
          }
        </div>
      </div>
      <div className="frontend-card">
        <div className="head">
          <h2 >Back End</h2>
        </div>
        <div className="card">
          {
            backendList.map((each) => <BackEnd appDetails={each} key={each.appId} change1={change1} isActive={each.appName === b ? true : false} />)
          }
        </div>
      </div>
      <div className="frontend-card">
        <div className="head">
          <h2 >Database</h2>
        </div>
        <div className="card">
          {
            dadatabaseList.map((each) => <Database appDetails={each} key={each.appId} change2={change2} isActive={each.appName === d ? true : false} />)
          }
        </div>
      </div>
      <div>
        <button type="button" onClick={CallApi} className="button">Submit </button>
      </div>
    </div>
  )
}

export default App;
